import React from 'react';
function LeftSection({imageURL, productName,productDiscription,tryDemo,learnMore,googlePLay,appStore}) {
    return (  
        <div className='container'>
            <div className='row'>
                <div className='col-6 p-3'>
                    <img src={imageURL}/>
                </div>
                   <div className='col-6'>
                    <h1>{productName}</h1>
                    <p></p>
                   </div>
            </div>

        </div>
    );
}
export default LeftSection;
